from jinja2 import Environment, FileSystemLoader
import yaml
import json
import os
import base64
from PIL import Image
import io
import shutil
from datetime import datetime

class PageGenerator:
  def __init__(self, config_file_path, json_data, sitemap_path, image_data=None):
    with open(config_file_path, 'r', encoding='utf-8') as f:
      self.config = yaml.safe_load(f) 
    print(self.config)
    self.json_data = json_data
    self.sitemap_path = sitemap_path
    
    self.clean_filename = self.clean_filename()
    
    # Copy the necessary script and styling files to the project directory
    self.copy_file_if_not_exists("page_generator_package/js/pgJs.js", "../js/pgJs.js")
    self.copy_file_if_not_exists("page_generator_package/css/pg-queries.css", "../css/pg-queries.css")
    self.copy_file_if_not_exists("page_generator_package/css/pg-style.css", "../css/pg-style.css")
    if image_data is not None:
       images_folder = f"../{self.config['sub_domain']}/img"
       # Create the directory if it doesn't exist
       os.makedirs(images_folder, exist_ok=True)
       self.image_paths = self.save_images(image_data, images_folder, self.clean_filename)

  def copy_file_if_not_exists(self, source, destination):
    if not os.path.exists(destination):
      shutil.copy(source, destination)
  
  def clean_filename(self):
    name = self.json_data["name"].replace('-', ' ').replace('/', '').replace('å', 'a').replace('ä', 'a').replace('ö', 'o').replace('Å', 'A').replace('Ä', 'A').replace('Ö', 'O').lower()
    return '-'.join(name.split()).lower()
  
  def save_webp_image(self, base64_data, output_path):
    # Decode the base64 data
    decoded_data = base64.b64decode(base64_data)

    # Open the image from the decoded data
    img = Image.open(io.BytesIO(decoded_data))

    # Save the image as a WebP file
    img.save(output_path, "WEBP", quality=100)
  def save_images(self, images, output_folder, filename_prefix):
    image_paths = []
    index_of_first_image = 1
    for i, image_data in enumerate(images):
        if image_data is not None:
            image_filename = f"{filename_prefix}_{index_of_first_image}.webp"
            image_path = os.path.join(output_folder, image_filename)
            # Check if the image file already exists
            if not os.path.exists(image_path):
                self.save_webp_image(image_data, image_path)
            else:
                print(f"Skipped saving image '{image_filename}' as it already exists.")
            image_paths.append(image_filename)
            index_of_first_image += 1

    return image_paths

  def generate_page(self):
    # Load the Jinja2 template
    # Get the directory path of the current script
    script_dir = os.path.dirname(os.path.abspath(__file__))

    # Set up Jinja2 environment
    env = Environment(loader=FileSystemLoader(searchpath=script_dir))
    # Register the filter function with the Jinja2 environment
    template = env.get_template("page_template.html")

    # Format the data for the template
    formatted_data = {
      "config": self.config,
      "event": self.json_data,
      "image_paths": self.image_paths
    }
    

    # Render the template with the formatted data
    html = template.render(data=formatted_data)
    page_path = f"../{self.config['sub_domain']}/{self.clean_filename}.html"
    print(f"Saving page to {page_path}")
    # Save the generated HTML page
    with open(page_path, 'w', encoding='utf-8') as f:
      f.write(html)

  def update_sitemap(self):
    #impute sitemap with new page
    sitemap_url = f"https://loppkartan.se/{self.config['sub_domain']}/{self.clean_filename}"
    sitemap_url = sitemap_url.replace('&', '&amp;') 

    with open(self.sitemap_path, 'r', encoding='utf-8') as f:
      sitemap = f.read()
      if sitemap_url in sitemap:
        print(f"Skipped adding '{sitemap_url}' to sitemap as it already exists.")
        return
      sitemap = sitemap.replace("</urlset>",f'<url>\n  <loc>{sitemap_url}</loc>\n  <lastmod>{datetime.now().isoformat()}+00:00</lastmod>\n  <priority>0.8</priority>\n</url>')
      
    with open(self.sitemap_path, 'w', encoding='utf-8') as f:
      f.write(sitemap)
  
  def update_current_event(self, current_events):
    # If race already in active races, update "website" keys in current_events
    new_race=True
    for i, all_race in enumerate(current_events):
        if all_race["id"] == self.json_data["id"]:
            current_events[i]["website_organizer"] = self.json_data["website"]
            current_events[i]["website"] = f'/race-pages/{self.clean_filename}.html'
            new_race = False
            break
        #Else append the race to all_races_data
    if new_race:
        #Update website
        self.json_data["website_organizer"] = self.json_data["website"]
        self.json_data["website"] = f'/race-pages/{self.clean_filename}.html'
        # Keep only specific keys from the race dictionary
        keys_to_keep = [
            "date", "type", "name", "distance", "distance_m",
            "place", "latitude", "longitude", "organizer",
            "website", "src_url", "county",
             "id", "summary", "website_organizer"
        ]
    
        # Create a new dictionary with only the specified keys
        selected_race = {key: self.json_data[key] for key in keys_to_keep}
        selected_race["new_version"] = True

        return current_events.append(selected_race)
    return current_events

